import React from 'react';

export default function Newsfeed({ newsfeed }) {

	return (

		<div className='newsfeed-list__wrapper'>
			<ul>
				{
					newsfeed.map((article) => (
						<li key={article.guid._text}>{article.title._cdata}</li>
					))

				}
			</ul>
		</div>
	)

}
